import './App.css';
import {
  createBrowserRouter,
} from "react-router-dom";
import Home from './components/pages/home/home';
import Club from './components/pages/club/club';
import {
  RouterProvider,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
  },
  {
    path: "/club/:clubId",
    element: <Club />,
  },
]);

const App = () => {
  return (
    <>
    <RouterProvider router={router} />

    </>
  );
}


export default App;
